  false,\n\t\"url\": null,\n\t\"notes\": \"Data from Coral Reef Ecosystem Division
  (CRED), NOAA Pacific Islands Fisheries Science Center (PIFSC) Sea Surface Temperature
  (SST) Buoys provide a time series of surface water temperature at coral reef sites.
  The SST buoy (Model SST-001, Sound Ocean Systems, Inc., www.soundocean.com/index.htm)
  with external temperature recorder (Sea-Bird Model SBE39, Sea-Bird Electronics,
  Inc., www.seabird.com) telemeters a subset of the daily data in Near Real Time (NRT)
  via a Telonics ST-13 or ST-20 ARGOS PPT transmitter and internally records higher
  resolution temperature data from the SBE39, typically at a 600 second sampling interval
  for a duration of 2 years. This record refers to the internally recorded (high resolution
  in situ) SBE39 temperature data. When a SST buoy is recovered, a new one is typically
  deployed in the same place. Time series data combining multiple deployments from
  a given site may also be available. Please contact CRED with any questions. For
  program information see the web site https://www.pifsc.noaa.gov/cred/ocean_and_climate_change.php\",\n\t\"license_title\":
